import React from 'react';
import { connect } from 'react-redux';

const Interactives = ({}) => {
  return <div>Hu</div>;
};

const mapStateToProps = (state) => {
  return {
    messageList: state,
  };
};

export default connect(mapStateToProps)(Interactives);
